function Mensaje() {
  return (
    <Toast>
      <Toast.Header>
        <img src="holder.js/20x20?text=%20" className="rounded me-2" alt="" />
        <strong className="me-auto">Mensaje</strong>
        <small>Ahora</small>
      </Toast.Header>
      <Toast.Body></Toast.Body>
    </Toast>
  );
}

export default Mensaje;
